import React, { Component, createContext } from 'react'

/*
class Header extends React.Component()
{
    constructor(props) {
        super(props);
     
      }
    render() {
        return (
            <div className={`row`}>
            
                <img src={'images/carwalelogo.png'} width="30" height="30" />
    
                Carwale
            </div>
        );
      }
}


export default Header;

*/

class Header extends React.Component {
    constructor(props) {
      super(props);
    
  
    }
  
   
  
    render() {
      return (
        <header>
        <div class="main">
            <ul>
                <li><a href="#">Swift</a></li>
                <li><a href="#">VARIANTS</a></li>
                <li><a href="#">360 VIEW</a></li>
                <li><a href="#">IMAGESS</a></li>
            </ul>
        </div>
    </header>
      );
    }
  }
  



export default Header;
